      .flex();
      .amount {
        font-size: 30px;
        color: #e74938;
        font-weight: bold;
      }
    }
  }
  .discount-rights {
    margin-top: 40px;
    .rights-list {
      width: 100%;
      margin-top: 20px;
      list-style-type: none;
      .flex();
      align-items: center;
      flex-wrap: wrap;
      li {
        width: 49%;
        height: 80px;
        padding: 0 24px;
        background: #fafafa;
        border-radius: 4px;
        border: 1px solid transparent;
        &.active {
          border: 1px solid #025eff;
          // background: #fff;
        }
        &:nth-child(odd) {
          margin-right: 20px;
        }
        .flex();
        align-items: center;
        .list-left {
          .flex();
          align-items: center;
          .discout {
            font-size: 30px;
            font-weight: bold;
