              font-weight: bold;
              &.count {
                margin-top: 8px;
                font-size: 12px;
                color: #666;
                font-weight: 400;
              }
            }
          }
        }
        .list-right {
          width: 20px;
          .inherit {
            color: #dfdfdf;
            font-size: 20px;
            &.active {
              color: #025eff;
            }
          }
        }
