    margin-top: 16px;
    border-top: 1px dashed #dedede;
    padding: 56px 0 63px 0;
    .flex();
    align-items: center;
    .pay-left {
      font-size: 14px;
      span {
        margin-right: 5px;
        font-size: 30px;
        color: #e74938;
        font-weight: bold;
        font-family: DINAlternate-Bold, DINAlternate;
      }
